import React, { useState } from 'react';
import './Gethelp.css';

const locationsData = {
  'Madhya Pradesh': [
    { name: 'Indore', mapLink: 'https://www.google.com/maps/embed?pb=!1...!2d75.8882503!5e0' },
    { name: 'Bhopal', mapLink: 'https://www.google.com/maps/embed?pb=!1...!2d77.4033474!5e0' },
    { name: 'Betul', mapLink: 'https://www.google.com/maps/embed?pb=!1...!2d77.9054047!5e0' },
    // Add more locations and their centers here
  ],
  // Add more states and their locations here
};

export default function Gethelp() {
  const [selectedLocation, setSelectedLocation] = useState('Madhya Pradesh');

  const handleLocationChange = (event) => {
    setSelectedLocation(event.target.value);
  };

  return (
    <div>
      <div className='textplacer'>
        <p className='logo1 '>Where are you located ?</p>
      </div>

      <div className='selectContainer scroll'>
        <select className='dropdown' onChange={handleLocationChange} value={selectedLocation}>
          {Object.keys(locationsData).map((state) => (
            <option key={state} value={state}>
              {state}
            </option>
          ))}
        </select>
      </div>

      <div>
        <div className='locations'>
          {locationsData[selectedLocation].map((center, index) => (
            <div key={index} className='locaname'>
              &#8226; {center.name}
              <div className='locamap'>
                <iframe title={center.name} src={center.mapLink} width="640" height="480"></iframe>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
